import React from "react";
import { Bar } from "react-chartjs-2";

const BarChartData = ({ labels, data, backgroundColor, borderColor }) => {
  const chartData = {
    labels: labels || [],
    datasets: [
      {
        label: "total count/value",
        data: data || [],
        backgroundColor: backgroundColor || "rgba(75,192,192,0.2)",
        borderColor: borderColor || "rgba(75,192,192,1)",
        borderWidth: 1,
      },
    ],
  };

  const options = {
    maintainAspectRatio: false,
    scales: {
      yAxes: [
        {
          ticks: {
            beginAtZero: true,
          },
        },
      ],
    },
    legend: {
      labels: {
        fontSize: 15,
      },
    },
  };

  return (
    <div>
      <h2>Price Ranges Bar Chart</h2>
      <Bar data={chartData} options={options} height={400} />
    </div>
  );
};

export default BarChartData;
